import React from 'react';
import '../App.css';
import { Flex, Box } from 'rebass'

const gameStyle = {
  align: 'center',
  width: '100%'
}

const dealerStyle = {
  height: '250px',
  background: 'blue',
  width: '100%',
}

const playerStyle = {

}

const aiStyle = {

}

const BlackjackGame = () => {
  return (
    <Box style={gameStyle}>
      <Box style={dealerStyle}>
        Dealer
      </Box>
      <div style={playerStyle}>
        Player
        <button>HIT</button>
        <button>STAY</button>
        <button>PLAY AGAIN</button>
      </div>
      <div style={aiStyle}>
        AI
      </div>
    </Box>
)
}

export default BlackjackGame;
